import { Component } from "react";
import React from 'react';

import Balance from "./components/Balance";

class App extends Component {
  constructor() {
    super();

    this.state = {
      balance: 0,
    };
  }

  render() {
    return (
      <div>
        <Balance balance={this.state.balance}> </Balance>
      </div>
    );
  }
}

export default App;
